import { BrowserRouter as Router, Route, Switch,Redirect } from 'react-router-dom'

ReactDOM.render(
  <Router>
    <Switch>
      <Route  path='/' component={App} />
      <Route  path='/list:id' component={List} />
      <Route  path='/detail' component={Detail} />
      <Redirect to />
    </Switch>
  </Router>,
  document.getElementById('root')
);
reportWebVitals();
